DELIMITER $$
CREATE TRIGGER `trg_update_overdue_status` BEFORE UPDATE ON `transactions` FOR EACH ROW BEGIN
  IF NEW.status = 'active' AND NEW.due_date < CURDATE() AND OLD.status != 'returned' THEN
